import logo from './logo.svg';
import './App.css';

const DUMMY_DATA = [
  {
    provider_id : "user",
    utterance : "Hi!"
  },
  {
    provider_id : "chatbot",
    utterance : "Hi! My name is iFetch, how can I help you?"
  }
]

function ChatWindow(props) {
  return (
    <ul className="message-list">                 
      {props.messages.map(message => {
        return (
          <li key={message.id}>
            <div>
              {message.provider_id}
            </div>
            <div>
              {message.utterance}
            </div>
          </li>
        )
      })}
    </ul>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
